import './App.css';
import Button from './components/button/button';
import Card from './components/card/card';
import {ColorLetter } from './components/colorLetter/colorLetter';
import Hand from './components/hand/hand';
import Logo from './components/logo/logo';

function App() {
    const handOfMonsters=[
      {name:"Pipo",color:"#F2DFDF"},
      {name:"Chuky",color:"#6BBABB3B"},
      {name:"Lupo",color:"#F2AADF"},
    ];



    return (
    <div className="App">
         <Logo />
         <Hand  monsters ={handOfMonsters}  />
         <button>Random Hand</button>
         <Button />
    </div>
    );
};

export default App;
